import logo from './logo.svg';
import './App.css';
//import Homepage from "./Homepage"
//import Secondpage from './Secondpage';
import Routes from './Route';
import { BrowserRouter } from "react-router-dom"
import { Container } from 'react-bootstrap';

function App() {

  return (
    <>
      <Container fluid>
        <BrowserRouter>
          <Routes />
        </BrowserRouter>
      </Container>
    </>
  );
}

export default App;
